CREATE TABLE `orders` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `user_id` mediumint default NULL,
  `sumtotal` mediumint default NULL,
  `bonus` mediumint default NULL,
  `vatrate` ENUM ('reduced','full') NOT NULL,
  `payment_status` ENUM ('open','paid','chargeback','refund','inkasso') NOT NULL,
  `created_at` DATETIME,
  `hold_status` ENUM ('hold','unhold','free') NOT NULL,
  `currency` ENUM ('EUR','USD','SEK','DKK','NOK') NOT NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

